std::string get_service_table_routine_name_internal(const uint32_t index,
                                                    const uint32_t max_count,
                                                    const char** service_table) {
    if ( service_table && max_count && index < max_count )
        return service_table[index];

    return "*UNKNOWN*";
}

std::string get_service_table_prefix_name(const ServiceTableType type) {
    if ( type == KiServiceTable_x86 || type == KiServiceTable_x64 ) return "nt!";
    else if ( type == W32pServiceTable_x86 || type == W32pServiceTable_x64 ||
              type == W32pServiceTableFilter_x86 || type == W32pServiceTableFilter_x64 ) return "win32k!";
    else if ( type == LxpSyscalls_x64 ) return "";

    return "";
}

std::string get_service_table_routine_name(const uint32_t minor_build,
                                           const ServiceTableType type,
                                           const uint32_t index) {
    std::string routine = get_service_table_prefix_name(type);
    uint32_t max_count = 0;
    const char** service_table = nullptr;

    if ( minor_build <= WXP_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableXpSp3];
        service_table = Service_Tables[type][ServiceTableXpSp3];
    } else if ( minor_build > WXP_VER && minor_build <= W2K3_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableW2k3Sp2];
        service_table = Service_Tables[type][ServiceTableW2k3Sp2];
    } else if ( minor_build > W2K3_VER && minor_build <= VISTA_RTM_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableVistaSp0];
        service_table = Service_Tables[type][ServiceTableVistaSp0];
    } else if ( minor_build > VISTA_RTM_VER && minor_build <= VISTA_SP1_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableVistaSp1];
        service_table = Service_Tables[type][ServiceTableVistaSp1];
    } else if ( minor_build > VISTA_SP1_VER && minor_build <= VISTA_SP2_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableVistaSp2];
        service_table = Service_Tables[type][ServiceTableVistaSp2];
    } else if ( minor_build > VISTA_SP2_VER && minor_build <= W7RTM_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableW7Sp0];
        service_table = Service_Tables[type][ServiceTableW7Sp0];
    } else if ( minor_build > W7RTM_VER && minor_build <= W7SP1_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableW7Sp1];
        service_table = Service_Tables[type][ServiceTableW7Sp1];
    } else if ( minor_build > W7SP1_VER && minor_build <= W8RTM_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableW8Sp0];
        service_table = Service_Tables[type][ServiceTableW8Sp0];
    } else if ( minor_build > W8RTM_VER && minor_build <= W81RTM_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableW8Sp1];
        service_table = Service_Tables[type][ServiceTableW8Sp1];
    } else if ( minor_build > W81RTM_VER && minor_build <= W10RTM_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableW10Th1];
        service_table = Service_Tables[type][ServiceTableW10Th1];
    } else if ( minor_build > W10RTM_VER && minor_build <= W10TH2_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableW10Th2];
        service_table = Service_Tables[type][ServiceTableW10Th2];
    } else if ( minor_build > W10TH2_VER && minor_build <= W10RS1_VER ) {
        max_count = Service_Tables_countof[type][ServiceTableW10Rs1];
        service_table = Service_Tables[type][ServiceTableW10Rs1];
    } else {
        return "*UNKNOWN*";
    }

    return routine.append(get_service_table_routine_name_internal(index, max_count, service_table));
}

